description:
Sri Mahaganapathiravathu mam, composed by Muthuswamy Dikshitar, as taught by Sri P.S. Narayanaswamy.

This is part of a series of music lessons for the inaugural concert of the 2007 Cleveland Thyagaraja Aradhana.

